function encodeURIWithSafe(str, safe, skipEncoding){
	str = String(str);
	if (str.length === 0) {
		return '';
	}
	if (skipEncoding) {
		return str;
	}
	let ret;
	if (safe) {
		ret = [];
		for (const element of str) {
			ret.push(safe.indexOf(element) >= 0 ? element : encodeURIComponent(element));
		}
		ret = ret.join('');
	} else {
		ret = encodeURIComponent(str);
	}
	return ret.replace(/!/g, '%21')
		.replace(/\*/g, '%2A')
		.replace(/'/g, '%27')
		.replace(/\(/g, '%28')
		.replace(/\)/g, '%29');
}

